package com.a605.cse.audiosampler.dataobjects;/** * Created by might on 10/23/17. * Updated */public class AudioDataObject {    public static int counter;    private String timestamp;    private String amplitude;    private String frequency;    private String intensity;    private String sequenceNumber;    private String deviceId;    private AudioDataObject() {        this.sequenceNumber = String.valueOf(++counter);    }    public AudioDataObject(String _amplitude, String _frequency, String _intensity, String _deviceId, String _timestamp) {        this();        this.amplitude = _amplitude;        this.frequency = _frequency;        this.intensity = _intensity;        this.deviceId = _deviceId;        this.timestamp = _timestamp;    }}